const monthDescription = `
  Plejamento Nutricional
  Periodização de Treino
  Feedbacks Quinzenais
  O que quiser adicionar...
`;

const planData = [
  {
    title: 'Mensal',
    description: monthDescription,
    value: 300,
  },
  {
    title: 'Trimestral',
    description: monthDescription,
    value: 800,
  },
  {
    title: 'Semestral',
    description: monthDescription,
    value: 1500,
  },
];

export default planData;
